Everyone's favorite groovy super heroine is back in all new four-issue mini-series! After being reawakened in our era, Judo Girl finds herself more isolated than ever. And after a tragic battle with a former nemesis, Judo Girl decides to hang up her go-go boots forever! Judo Girl reluctantly dons her super-hero guise, but as she works undercover with the Revolution, she discovers their anarchist beliefs jive with her '60s sensibilities. Now, Judo Girl must decide which side she's really on.

